import logo from "./logo.svg";
import "./App.css";
import Form from "./Form";
import { UrlProvider } from "./url-context";
import Particle from "./Particle";

function App() {
  return (
    <UrlProvider>
      <div className="App">
        <header className="App-header">
          <Form />
          <Particles />
        </header>
      </div>
    </UrlProvider>
  );
}

export default App;
